import React, { useState } from "react";
import Sketch from "react-p5";

export default function TestSketch() {
  const [ellipseOne, setEllipseOne] = useState(255, 130, 20);
  const setup = (p5, canvasParentRef) => {
    p5.createCanvas(500, 400).parent(canvasParentRef);
  };

  const mouseClicked = (_p5, event) => {
    console.log("event: ", event.background.draw);
  };

  const draw = (p5) => {
    p5.background(255, 130, 20);
    p5.ellipse(ellipseOne);
    p5.ellipse(300, 100, 100);
  };

  return (
    <>
      <Sketch setup={setup} draw={draw} />
      <button color="blue" onClick={mouseClicked} />
    </>
  );
}
